import React, { useState } from "react";
import {
  useAddBookingMutation,
  useCreateBookingMutation,
  useGetBookingsQuery,
} from "../../redux/api/bookingApi";
import { Link } from "react-router-dom";
import { useGetUsersQuery } from "../../redux/api/adminApi";

const BookingList = () => {
  const { data: users = [] } = useGetUsersQuery();
  const { data: bookings = [], refetch } = useGetBookingsQuery();
  const [addBooking] = useCreateBookingMutation();

  const [formData, setFormData] = useState({
    user: "",
    fromPlace: "",
    toPlace: "",
    travelDate: "",
    travelTime: "",
    flightType: "",
    remarks: "",
    totalAmount: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await addBooking({ ...formData });
      setFormData({
        user: "",
        fromPlace: "",
        toPlace: "",
        travelDate: "",
        travelTime: "",
        flightType: "",
        remarks: "",
        totalAmount: "",
      });
      refetch();
    } catch (err) {
      console.error("Failed to add booking:", err);
    }
  };

  return (
    <div className="container mt-4">
      <h2>Add Booking</h2>
      <form className="row g-3 mb-4" onSubmit={handleSubmit}>
        <div className="col-md-4">
          <label className="form-label">Traveler</label>
          <select
            className="form-select"
            name="user"
            value={formData.user}
            onChange={handleChange}
            required
          >
            <option value="">Select User</option>
            {users?.users?.map((u) => (
              <option key={u._id} value={u._id}>
                {u.name} ({u.email})
              </option>
            ))}
          </select>
        </div>
        <div className="col-md-3">
          <label className="form-label">From</label>
          <input
            type="text"
            className="form-control"
            name="fromPlace"
            value={formData.fromPlace}
            onChange={handleChange}
            required
          />
        </div>
        <div className="col-md-3">
          <label className="form-label">To</label>
          <input
            type="text"
            className="form-control"
            name="toPlace"
            value={formData.toPlace}
            onChange={handleChange}
            required
          />
        </div>
        <div className="col-md-2">
          <label className="form-label">Flight Type</label>
          <input
            type="text"
            className="form-control"
            name="flightType"
            value={formData.flightType}
            onChange={handleChange}
            required
          />
        </div>
        <div className="col-md-3">
          <label className="form-label">Travel Date</label>
          <input
            type="date"
            className="form-control"
            name="travelDate"
            value={formData.travelDate}
            onChange={handleChange}
            required
          />
        </div>
        <div className="col-md-3">
          <label className="form-label">Travel Time</label>
          <input
            type="time"
            className="form-control"
            name="travelTime"
            value={formData.travelTime}
            onChange={handleChange}
            required
          />
        </div>
        <div className="col-md-3">
          <label className="form-label">Total Amount</label>
          <input
            type="number"
            className="form-control"
            name="totalAmount"
            value={formData.totalAmount}
            onChange={handleChange}
            required
          />
        </div>
        <div className="col-md-6">
          <label className="form-label">Remarks</label>
          <textarea
            className="form-control"
            name="remarks"
            rows="2"
            value={formData.remarks}
            onChange={handleChange}
          />
        </div>
        <div className="col-12 text-end">
          <button type="submit" className="btn btn-primary">
            Add Booking
          </button>
        </div>
      </form>

      <h3>All Bookings</h3>
      <table className="table table-bordered">
        <thead>
          <tr>
            <th>ID</th>
            <th>Traveler</th>
            <th>From → To</th>
            <th>Travel Date/Time</th>
            <th>Status</th>
            <th>Total</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {bookings.map((b) => (
            <tr key={b._id}>
              <td>{b._id.slice(-5)}</td>
              <td>{b.user?.name}</td>
              <td>
                {b.fromPlace} → {b.toPlace}
              </td>
              <td>
                {b.travelDate} {b.travelTime}
              </td>
              <td>{b.status}</td>
              <td>₹{b.totalAmount}</td>
              <td>
                <Link
                  to={`/admin/bookings/${b._id}`}
                  className="btn btn-sm btn-outline-primary"
                >
                  View
                </Link>
              </td>
            </tr>
          ))}
          {bookings.length === 0 && (
            <tr>
              <td colSpan="7" className="text-center">
                No bookings found.
              </td>
            </tr>
          )}
        </tbody>
      </table>
    </div>
  );
};

export default BookingList;
